import styled from "styled-components";
import Title from "./components/title";
import Flex from "./components/flex";

const StAppWrapper = styled.div`
  width: 100%;
  min-height: 100vh;
  padding: 2rem;
  background: black;
`


function App() {
  return (
    <StAppWrapper >
        <Flex> <Title color={'white'}>Console cmd 2023. Sergey</Title></Flex>
    </StAppWrapper>
  );
}

export default App;
